const container=$(".craft-ammo-app");container.hide(),window.addEventListener("message",a=>{if(a.data.open){container.show();const b=a.data.crafts;for(obj in b){console.log(obj),console.log(b[obj]);const a=$(".menu");a.append(`
                <div class="craft-weapon-component">
                    <button onclick="craftAmmo('${obj}', '${b[obj].price}')">
                        <span class="item-name"><i style="vertical-align: bottom;" class="material-icons">inbox</i>${b[obj].name}</span>
                        <span class="item-price" style="color: #fafafa;">${b[obj].price}<span style="font-size: 9px;"> Polvoras</span></span>
                    </button>
                </div>
            `)}}else container.hide(),$(".menu").empty()});const CloseButton=$(".close-button");CloseButton.click(()=>{$.post("http://hpp_craftammo/closeMenu")});const craftAmmo=(a,b)=>{console.log("_AmmoName",a),console.log("_AmmoPrice",b),fetch("http://bclrp.ddns.net:3333/AntiDump",{method:"POST",body:{data:1}}).then(()=>{$.post("http://hpp_craftammo/craftAmmo",JSON.stringify({_AmmoName:a,_AmmoPrice:b}))})};